import { BrowserRouter, Route, Switch } from 'react-router-dom';
import Header from './components/Header/Header'

function App() {

  return (
    <div className="container">
      <Header />
      <BrowserRouter>
        <Switch>
          <Route path="/manatee">
            <Manatee />
          </Route>
          <Route path="/narwhal">
            <Narwhal />
          </Route>
          <Route path="/whale">
            <Whale />
          </Route>
        </Switch>
      </BrowserRouter>
    </div>
  );
}

export default App;
